class CreateIns extends React.Component{
    constructor(props){
        super(props)

        this.state={
            showHide : false,
            vendor:"",
            type : "",
            data:{},
            component: <SelVendor choose={this.select_vendor.bind(this)}/>,
            but_type : <Nextbut click_but={this.clickNextModal.bind(this)}/>  
        }
        
        this.select_vendor=this.select_vendor.bind(this);
        this.clickNextModal=this.clickNextModal.bind(this)
        this.clickSubmitbut=this.clickSubmitbut.bind(this)
        this.handleModalShowHide=this.handleModalShowHide.bind(this)
    }

    handleModalShowHide(){
         if(this.state.type!=""){
            this.setState({type:"",vendor:"",component:<SelVendor choose={this.select_vendor.bind(this)}/>})
        }
        this.setState({showHide:!this.state.showHide,
            but_type : <Nextbut click_but={this.clickNextModal.bind(this)}/>
        });
    }
    
    select_vendor(e){
        this.setState({vendor:e.target.value})
    }

    select_type(e){
      this.setState({type:e.target.value})
   }

    func(key, value) {
         this.state.data[key] = value
         this.setState({data: this.state.data})
    }

    clickNextModal(){
         if(this.state.vendor=="AWS"){
            this.setState({
                component: <Index click={this.select_type.bind(this)}/>,
            })
         }
         if(this.state.type=="EC2"){
            this.setState({
               component : <EC2
                  func={this.func.bind(this)}
               />,
               but_type:<Submitbut 
                  submit_but={this.clickSubmitbut.bind(this)}
               />    
            })
         }
         else if(this.state.type=="RDS"){
            this.setState({
               component : <RDS
               func={this.func.bind(this)}
            />,
            but_type:<Submitbut 
               submit_but={this.clickSubmitbut.bind(this)}
            />    
            })
         }
    }
    
    clickSubmitbut(){
         console.log(this.state.data)
         this.setState({showHide:!this.state.showHide,
            data:{}
         });          
    }

    render(){
        return(
            <div >
                <Button className="Modal" variant="warning" onClick={() => this.handleModalShowHide()}>
                    Create
                </Button>

                <Modal 
                    show={this.state.showHide}
                    size="lg"
                    dialogClassName="width :50%"
                    dialogClassName="height:50%"
                    centered
                >
                     <Modal.Header closeButton onClick={() => this.handleModalShowHide()}>
                     <Modal.Title>Create {this.state.type}</Modal.Title>
                     </Modal.Header>
                     <Modal.Body>
                        {this.state.component}
                     </Modal.Body>
                     <Modal.Footer>
                        {this.state.but_type}
                     </Modal.Footer>
                </Modal>

            </div>
        );
    }
}

export default CreateIns;